import { Container, Row, Col, Tab, Nav } from "react-bootstrap";
import projImg1 from "../assets/img/project-img1.png";
import projImg2 from "../assets/img/project-img2.png";
import projImg3 from "../assets/img/project-img3.png";
import projImg4 from "../assets/img/project-img4.png";
import projImg5 from "../assets/img/project-img5.png"
import { ProjectCard } from "./ProjectCard";
import colorSharp2 from "../assets/img/color-sharp2.png"

export const Projects = () => {

        const projects = [
            {
                title: "BMI Calculator",
                description: "A simple BMI calculator created for the sole purpose of helping others achieve their goal body weight. This application uses the Harris Benedict Equation to calculate 7 calorie goals suitable for the user, the project was made with simple html and css. This being my first offical project.",
                imgUrl: projImg4
            },
            {
                title: "Niner-Spikeball-Network",
                description: "placeholder2",
                imgUrl: projImg2
            },
            {
                title: "MyHealthPal",
                description: "placeholder3",
                imgUrl: projImg3
            },
        ];


        return (
            <section className="project" id="project">
                <Container>
                    <Row>
                        <Col>
                        <h2>Projects</h2>
                        <p>Below are some of the projects I have worked on!</p>
                        <Tab.Container id = "projects-tabs" defaultActiveKey="first">
                        <Nav variant="pills" className="nav-pills mb-5 justify-content align-items-center" id="pills-tab">
                            <Nav.Item>
                            <Nav.Link eventKey="first">Tab 1</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                            <Nav.Link eventKey="second">Tab 2</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                            <Nav.Link eventKey="third">Tab 3</Nav.Link>
                            </Nav.Item>
                        </Nav>
                        <Tab.Content>
                            <Tab.Pane eventKey={"first"}>
                                <Row>
                                    {
                                        projects.map((project, index) => {
                                            return(
                                                <ProjectCard
                                                key={index}
                                                {...project}
                                                />

                                            )
                                        })
                                    }
                                </Row>

                            </Tab.Pane>
                            <Tab.Pane eventKey="second">Tab Placeholder 2</Tab.Pane>
                            <Tab.Pane eventKey="third">Tab Placeholder 3</Tab.Pane>

                        </Tab.Content>

                        </Tab.Container>
                        </Col>
                    </Row>
                </Container>
                <img className="background-image-right" src={colorSharp2}/>
            </section>
        )
}
